        <Form id= "search-location">
        <Button type= "button"
        className= "btn btn-outline-light btn-sm"
        id= "exact-location-btn">
        <img src= { pin }
        alt= "blue-drop-pin"
        className= "blueDropPin"/>
        </Button>{" "}
