        className= "form-control-sm text-center border-info"
        id= "location-input"
        placeholder= "FIND A LOCATION"
          autocomplete="off"
        /> {" "}
        <input type= "submit"
        className= "search-btn btn-outline-light btn-sm"
        value= "🔍" />
        </Form> 
        </div>
    );
}
